import React from "react";
import {Spring} from "react-spring/renderprops";
import "./styles.css";

function Capsule({name, from, to, config, background}) {
  return (
    <Spring
      from = {from}
      to = {to}
      config = {config}
      background = {background}>
      {(props) => (
        <div style={props} style={TabSpacing}>
          <div className="Tabs">{name}</div>
        </div>
      )}
    </Spring>
  );
}

const TabSpacing = {
  // paddingRight: "20px",
}
export default Capsule;
